import React from 'react';

function Cartoon() {
  return (
    <div>
      <h1>Cartoon</h1>
      <video controls width="600">
        <source src="/assets/videos/sample.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>
    </div>
  );
}

export default Cartoon;
